def ApproximatePatternMatching(Text,Pattern,d) :
    position = []
    for i in range (len(Text) - len(Pattern) + 1) :
        if HammingDistance(Text[i:i+len(Pattern)] , Pattern) <= d :
            position.append(i)
    return position 
def HammingDistance(p,q) :
    distance = 0
    for i in range (len(p)) :
        if p[i] != q[i] :
            distance += 1
    return distance 
